var Web2Call = function (w2c_obj) {
    "use strict";

    // произнак того что w2c был загружен, дабы не загружать вновь при 
    // установке соединения
    this.loaded = false;
    // конфиг, который присылает бекенд 
    this.config = w2c_obj.config;

    // сLog работает если бекенд в конфиге прислал debug=true
    this.cLog('init');
    // token для установки соединение по вебсокетам
    this.token = w2c_obj.token;

    // Позволяет в сыром виде показывать содержимое массивов
    this.cLog_raw(w2c_obj);

    //id дом попап окна сервиса
    this.idSW = 'w2cel_showServiceWindow'; 
    //id дом фона попап окна сервиса
    this.idSWBG = 'w2cel_showServiceWindowBg'; 
    //дом кнопки вызова сервиса (маленький телефон что крутится у номера телефона)
    this.pSB = '.w2c_sb'; 
    //id дом уговлого окошка сервиса
    this.idSH = 'w2cel_showServiceHint';
    // устанавливаем соединение с сокет сервером
    this.initWebSocket();

};

// создаем окно внизу справа
Web2Call.prototype.makeServiceWindow = function () {
    'use strict';

    this.cLog('makeServiceWindow');

    var time = new Date();

    // ограничиваем работу диапозоном рабочего времени фирмы
    // для того что бы звонки не сыпались в не рабочее время
    if (this.config.work_time_to && this.config.work_time_from && (this.config.work_time_to > time.getHours() || time.getHours() >= this.config.work_time_from)){
        return;
    }

    //ставим кнопочку с трубкой в угол экрана
    var showServiceHint = '<div id="'  +  this.idSH  +  '" class="w2c_h">',
        showServiceBtn = '<span id="w2cel_showServiceBtn" class="w2c_sb"><img src="' + this.config.icon + '"></span>';

    showServiceHint  += '<div class="w2c_hhead"><img src="'+this.config.title_icon+'"><span style="">КОНСУЛЬТАНТ</span></div>';
    showServiceHint  += '<div class="w2c_hbody">Возникли вопросы? Мы готовы помочь вам прямо сейчас!</div>';
    showServiceHint  += '</div>';

    showServiceHint = '<div class="hi-icon-effect-8"><div id="' + this.idSH + '"class="hi-icon w2c_h">'
    showServiceHint += '<img src="images/phone.png" width="50px" height="50px"/>'
    showServiceHint += '</div></div>'

    w2c_jQuery('body').append(showServiceHint);

    w2c_jQuery('#' + this.idSH).click(function () {
        w2cMain.makeMainWindow();
        w2cMain.showMainWindow();
    });

    // задаем тему заголовка окна

    // создаем крутящуюсю трубку у номера телефона на сайте
    w2c_jQuery(this.config.phone_div).prepend(showServiceBtn);

    w2c_jQuery(this.pSB)
        .click(function () {
            w2cMain.makeMainWindow();
            w2cMain.showMainWindow();
        });

    this.AnimateRotate(360);
    // W2CVars['service_show_timeout'] = setTimeout(function () { w2c_jQuery('#' + W2CVars.idSH).animate({'opacity': 1},1000) },0.1*1000);

    this.intelligentShow();
};


// механизм интеллектуального показа информационного окна
// на данный момент 2 критерия
// время на сайте, либо прокрутка сайта до половины
Web2Call.prototype.intelligentShow = function() {
    // var viewportWidth = Math.max(document.documentElement.clientWidth, window.innerWidth || 0);
    // высота видимой части окна
    var viewportHeight = Math.max(document.documentElement.clientHeight, window.innerHeight || 0);

    var body = document.body,
        html = document.documentElement;

    // полная высота сайта
    var page_height = Math.max( body.scrollHeight, body.offsetHeight, 
                           html.clientHeight, html.scrollHeight, html.offsetHeight );


    // показываем окно через time_in_site секунд на сайта
    this.time_in_site_timeout = setTimeout(function(){
        w2cMain.cLog('call.timeout');
        w2c_jQuery(window).unbind( "scroll" );
        w2cMain.showServiceWindow(); 
    }, w2cMain.config.time_in_site*1000);

    // критерий скроллинга страницы
    w2c_jQuery( window ).scroll(function() {
        w2cMain.cLog('call.scroll');
        if(w2c_jQuery(window).scrollTop()/(page_height-viewportHeight)>=0.5){
            w2c_jQuery(window).unbind( "scroll" );
            clearTimeout(w2cMain.time_in_site_timeout);
            w2cMain.showServiceWindow(); 
        }
    });

};

Web2Call.prototype.reCAPTCHAverifyCallback = function(response) {
    w2cMain.cLog(response);
    w2cMain.captcha_verify_key = response;
    w2c_jQuery('#w2cel_callBtn').removeClass('disabled').text('Заказать звонок');
};

// показываем сервисное окно, по клику на которое открывается главное окно
Web2Call.prototype.showServiceWindow = function () {
    'use strict';
    this.cLog('showServiceWindow');
    w2c_jQuery('#' + this.idSH).show();
    w2c_jQuery(this.pSB).animate({'opacity': 1}, 1000);
};

Web2Call.prototype.hideServiceWindow = function () {
    'use strict';
    this.cLog('hideServiceWindow');
    w2c_jQuery('#' + this.idSH).animate({'opacity': 0}, 1000);
    w2c_jQuery(this.pSB).animate({'opacity': 0}, 1000);
};

// показываем основное окно где клиент вводит номер телефона
Web2Call.prototype.makeMainWindow = function () {
    'use strict';
    var w2c_container = '<div id="w2c_container" class="w2c_c"></div>',
        html = ' <div id="w2cel_showServiceWindow" class="w2c_v">' +
            '<div class="headstep">' +
            '<img src="'+this.config.title_icon+'"><span style="">Мы можем перезвонить вам прямо сейчас!</span>'  +
            '</div>' +
            '<div class="bodystep">' +
            ' <div class="onestep">'  +
            //'     <!--<div id="companyLogo" style="height:90px; width:100%; text-align:center;">'  +
            //'     <img src="http://mgmn.alltel24.ru/static/pic/alltellogo2.png" style="height:100%"></div>-->'  +
            '<div class="manager">' +
            '  <img src="images/w2c-face.png"/>' +
            '  <div class="descr">Менеджер Анатолий</div>'  +
            '</div>' +
            '     <form>'  +
            '         <label for="w2c_clientNum">Ваш номер :</label><input type="text" class="clientNum" id="w2c_clientNum" placeholder="8-(___)-___-__-__" tabindex="0">'  +
            //'         <!--<p>Вы готовы принять звонок? Тогда нажмите кнопку ниже!</p>-->'  + 
            //'         <!--<a class="btn btn-success" id="w2cel_callBtn" style="display: inline-block; padding: 6px 12px; margin-bottom: 0px; font-size: 14px; font-weight: 400; line-height: 1.42857143; text-align: center; white-space: nowrap; vertical-align: middle; cursor: pointer; -webkit-user-select: none; border: 1px solid rgb(76, 174, 76); border-radius: 4px; color: rgb(255, 255, 255); background-image: none; background-color: rgb(92, 184, 92);">Заказать звонок</a>-->'  +
            '<div id="w2c_recaptcha"></div>'+
            '         <a class="btn btn-success btn-lg disabled" id="w2cel_callBtn">Введите капчу</a>'  +
            '     '  +
            '     </form>'  +
            ' </div>'  +
            ' <div id="twostep" style="height: 310px; margin-top: 40px;">'  +
            //'     <!--<h2 style="margin-bottom: 5px; font-size: 1.5em;">Отлично!</h2>-->'  + 
            '     <p id="hello">Шестеренки нашей АТС во всю гудят, пытаясь как можно скорее связать вас с нами.</p>'  +
            // '     <!--<h3>Немного статистики:</h3>-->'  +
            '     <p id="clientNum">Ваш номер: </p><a class="btn btn-danger" id="notMyNum">я ошибся, это не мой номер!</a>'  +
            '     <p id="opCount" style="display:none">Доступно операторов: 0</p>'  +
            '     <p id="callState">Соединение с сервисом успешно установлено!</p>'  +
            // '     <!--<a type="button" class="btn btn-danger" id="hideWindow">Закрыть</a>-->'  +
            ' </div>' +
            '</div>' +
            '</div>' +
            '<div id="w2cel_showServiceWindowBg" class="w2c_bg"></div>';
    w2c_jQuery('body').append(w2c_container);
    w2c_jQuery('#w2c_container').html(html);
    w2c_jQuery('#' + this.idSW+' .headstep').css(this.config.theme);

    w2c_jQuery('#' + this.idSW + ' .clientNum').mask("8-(999)-999-99-99", {placeholder: "_"});

    (function (w2c_jQuery) {
        w2c_jQuery.fn.setCursorPosition = function (start, end) {
            end = start;
            return this.each(function () {
                if (this.setSelectionRange) {
                    this.focus();
                    this.setSelectionRange(start, end);
                } else if (this.createTextRange) {
                    var range = this.createTextRange();
                    range.collapse(true);
                    range.moveEnd('character', end);
                    range.moveStart('character', start);
                    range.select();
                }
            });
        };
        w2c_jQuery.fn.getCursorPosition = function () {
            var input = this.get(0),
                result = '',
                sel = '',
                selLen = '';
            if (!input) {return; } // No (input) element found

            if ('selectionStart' in input) {
                // Standard-compliant browsers
                result = input.selectionStart;
            } else if (document.selection) {
                // IE
                input.focus();
                sel = document.selection.createRange();
                selLen = document.selection.createRange().text.length;
                sel.moveStart('character', -input.value.length);
                result = sel.text.length - selLen;
            }
            return result;
        };

    }(w2c_jQuery));

    //При клике по пустому полю выставляем курсор в начало 
    w2c_jQuery('#' + this.idSW + ' .clientNum').click(function () {
        if (w2c_jQuery(this).val() === '8-(___)-___-__-__' || w2c_jQuery(this).val() === '') {
            w2c_jQuery('#' + w2cMain.idSW + ' .clientNum').setCursorPosition(3);
        }
    });

    // при клике на поле ввода номера телефона автоматически ставим его в начало
    // если пол пустое 
    w2c_jQuery('#' + this.idSW + ' .clientNum').keypress(function (e) {
        var pos = w2c_jQuery('.clientNum').getCursorPosition() - 2;
        if (e.which === 13) {
            w2c_jQuery('#' + w2cMain.idSW + ' #w2cel_callBtn').click();
            return false;
        }
        if (w2c_jQuery('#' + w2cMain.idSW + ' .clientNum').val()[pos] === '_') {
            w2c_jQuery('#' + w2cMain.idSW + ' .clientNum').setCursorPosition(3);
            e.which = 0;
            return false;
        }
    });

    // клик на кнопку отмены вызова
    w2c_jQuery('#' + this.idSW + ' #notMyNum').click(function () {
        w2cMain.callCancel();
        w2c_jQuery('#callState').text('Разъединяем...');
        w2c_jQuery('#w2cel_callBtn').addClass('disabled').text('Введите капчу');
        // w2c_jQuery('#' + w2cMain.idSW + ' .onestep').animate({'margin-top':'0px'},1500, function () {w2c_jQuery('#' + w2cMain.idSW + ' #callState').text('Соденинение...');});
    });

    // w2c_jQuery('#' + this.idSW + ' #callCancel').click(function () {
    //     w2cMain.hideServiceWindow();        
    // });

    w2c_jQuery('#' + this.idSW + ' .clientNum').focus();

    //Кнопка дозвона звонок
    w2c_jQuery('#' + this.idSW + ' #w2cel_callBtn').click(function () {
        if (w2c_jQuery(this).is('.disabled')) {return false; }
        var config = {
            captcha_verify_key:w2cMain.captcha_verify_key,
            name : 'user',//w2c_jQuery('#' + w2cMain.idSW + ' .clientName').val(),
            phone : w2cMain.filterPhone(w2c_jQuery('#' + w2cMain.idSW + ' .clientNum').val()) //фильтруем номер, чтоб он был 89ххххххххх
        },
            scrollUp = '';
        if (config.name !== "" && config.phone !== "" && config.phone !== false && config.captcha_verify_key) {
            w2c_jQuery('#w2cel_callBtn').addClass('disabled').text('Звоню...');
            w2cMain.callStart(config); //пошел звонок
            scrollUp = w2c_jQuery('#w2cel_showServiceWindow .onestep').height() + 40;
            w2c_jQuery('#' + w2cMain.idSW + ' #twostep #clientNum').text('Ваш номер: ' + config.phone);

            w2c_jQuery('#' + w2cMain.idSW + ' .onestep').animate({'margin-top': -scrollUp + 'px'}, 1500);

            //program = setInterval(UpdateState,3000);
        } else {
            alert('Введите номер телефона!');
        }
    });
    w2c_jQuery('#' + this.idSWBG).click(function () {
        w2cMain.hideMainWindow();
    });

    // w2c_jQuery('#w2c_iframe').load(function () {
    //     W2CFunc.showServiceWindow();
    // });
};

