// заставляем крутится картинку у номера телефона
Web2Call.prototype.AnimateRotate = function (angle) {
    'use strict';
    var w2c_jQueryelem = w2c_jQuery(this.pSB + ' img');
    w2c_jQuery({deg: 0}).animate({deg: angle}, {
        duration: 2000,
        step: function (now) {
            w2c_jQueryelem.css({
                transform: 'rotate('  +  now  +  'deg)'
            });
        },
        complete: function () { w2cMain.AnimateRotate(angle); }
    });
};

//инициализируем в2к, соединяем сокеты
Web2Call.prototype.initWebSocket = function () {
    'use strict';
    this.cLog('initialize WebSocket');
    // this.cLog('init');
    this.socket = new w2c_SockJS(this.config.ws_serv);
    this.socket.onopen = function () {
        // w2cMain.cLog('initialize WebSocket - complete');
        w2cMain.cLog('WebSocket opened');
        clearInterval(w2cMain.reconnectTimer);
        w2cMain.socketAuth();
    };
    this.socket.onmessage = function (json) {
        w2cMain.cLog('I get: ');
        w2cMain.cLog_raw(json);
        w2cMain.cLog_raw(json.e);
        // w2cMain.cLog_raw(json.data);
        // w2cMain.cLog_raw(json.data.event);
        var state = json.data.event;
        switch (state) {
        // соединение установлено
        case 'ConnectEstablished':
            if (w2cMain.loaded === false) {
                w2cMain.loaded = true;

                w2cMain.grecaptcha_load_interval = setInterval(function(){
                    if(typeof grecaptcha == "undefined"){
                        console.log("grecaptcha don't load!");
                    } else {
                        clearInterval(w2cMain.grecaptcha_load_interval);
                        w2cMain.makeServiceWindow();
                    }
                },500);
                
            } 
            w2c_jQuery('#w2cel_callBtn').addClass('disabled').text('Введите капчу');
            break;
        // пошел звонок клиенту
        case 'CallToClient':
            //W2CFunc.showService();
            w2c_jQuery('#callState').text('Мы пытаемся до вас дозвониться. Пожалуйста, не сопротивляйтесь...');
            break;
        // звонок прекращен
        case 'callCanceled':
            // W2CFunc.hideMainWindow(); 
            // W2CVars.called = false;
            w2c_jQuery('#' + w2cMain.idSW + ' .onestep').animate({'margin-top': '0px'}, 1500, function () {w2c_jQuery('#' + w2cMain.idSW + ' #callState').text('Соденинение...'); });
            grecaptcha.reset(w2cMain.recapcha_id);
            w2c_jQuery('#w2cel_callBtn').addClass('disabled').text('Введите капчу');
            break;
        }
    };

    this.socket.onclose = function () {
        w2cMain.cLog('disconnected');
        w2c_jQuery('#w2cel_callBtn').addClass('disabled').text('Соединение...');
        w2cMain.socket = undefined;
        w2c_jQuery('#' + w2cMain.idSW + ' .onestep').animate({'margin-top': '0px'}, 1500, function () {w2c_jQuery('#' + w2cMain.idSW + ' #callState').text('Соденинение...'); });
        grecaptcha.reset(w2cMain.recapcha_id);
        // w2c_jQuery('#w2cel_callBtn').addClass('disabled').text('Введите капчу');
        w2cMain.reconnectTimer = setTimeout(function () {
            w2cMain.initWebSocket();
        }, 5000);
    };
};

//авторизация на сервере сокетов
Web2Call.prototype.socketAuth = function () {
    'use strict';
    var request = JSON.stringify({id: this.token, action: 'auth'});
    this.socket.send(request);
};

//console.log
Web2Call.prototype.cLog = function (text) {
    'use strict';
    if (console !== undefined && console.error !== undefined && this.config.debug === true) {
        console.log(this.dTime() + text);
    }
};

//console.log
Web2Call.prototype.cLog_raw = function (obj) {
    'use strict';
    if (console !== undefined && console.error !== undefined && this.config.debug === true) {
        console.log(obj);
    }
};

//фильтр для мобильников
Web2Call.prototype.filterPhone = function (phone) {
    'use strict';
    var p = phone;
    p = p.replace(/\D/gi, '');
    if (p[0] === '7') {p = p.replace('7', '8'); }
    if (p[0] !== '8') {p = false; }
    if (p[1] !== '9') {p = false; }
    if (p.length > 11) {p = false; }
    return p;
};

//Дозвон
Web2Call.prototype.callStart = function (config) {
    'use strict';
    //console.log(config);
    var request = JSON.stringify({phone: config.phone, name: config.name, action: "web2call", captcha_verify_key: config.captcha_verify_key});
    if (this.filterPhone(config.phone) !== false) {
        if (config.name !== null) {
            this.cLog('calling to ' + config.phone + ' of ' + config.name);
            this.socket.send(request);
            // this.called = true;
        }
    }
};

//Завершаем звонок
Web2Call.prototype.callCancel = function () {
    'use strict';
    var request = JSON.stringify({action: "cancel"});
    this.socket.send(request);
    this.cLog('call canceled');
};


Web2Call.prototype.dTime = function () {
    'use strict';
    var s = new Date(),
        res = '[' + s.getMinutes()  + ':' + s.getSeconds() + ':' + s.getMilliseconds() + '] web2call says: ';
    return res;
};

var w2cMain = new Web2Call(w2c_obj);
w2cMain.makeServiceWindow();
